import React from 'react';

import Palette from './Palette';
import seedColours from './seedsColours';
import { generatePalette } from './colourHelpers';

function App() {
  return (
    <div>
      <Palette palette={generatePalette(seedColours[2])}/>
    </div>
  );
}

export default App;
